Paul and Ringo Working Together Again posted by Evann Gastaldo, Newser Staff - Just now share 
(Two of) the Beatles are getting back together. Paul McCartney and Ringo Starr are collaborating for the first time since Starr's 2010 Y Not, Sky News reports. Starr tweeted a picture of the two together Sunday, writing, "Thanks for coming over man and playing Great bass. I love you man peace and love." { "position1" : { "type" : "artist", "id" : 4682, "name" : "Paul McCartney" } } 
Producer Bruce Sugar also posted a picture of himself with both former Beatles, calling it a "magical day in the studio." Starr, whose last album was in 2015, has been working on an as-yet-untitled follow-up since last year.
